import './App.css';
import Video from './component /video';
import data from './component /data/data';

function App() {

  // console.log(data)



  return (
    <div className='container'>
      {data.map(video => {
        <Video
        id={video.id}
        title={video.title}
        isVerified={video.isVerified}
        view={video.view}
        time={video.time}
        ></Video>
      })}
    </div>
  );
}

export default App;
